import React from 'react';
import './Cards.css';
import CardItem from './CardItem';

function Cards() {
  return (
    <div className='cards'>
        <h1>check out my projects!</h1>
        <div className='cards__container'>
            <div className='cards__wrapper'>
                <ul className='cards__items'>
                    <CardItem 
                    src='image4.jpeg'
                    text='youtube edits'
                    label='edits'
                    path='/projects'
                    />
                </ul>
            </div>
        </div>
    </div>
  )
}

export default Cards;
